import { BrowserRouter as Router } from "react-router-dom"
import AppRouter from "./components/AppRouter.js"


export default function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Auth />} />
                <Route path="profile" element={<Profile />} />
            </Routes>
        </Router>



    )
}
